import React from "react";
import Homepage from "pages/homepage";
import { Route } from "react-router-dom";
import "styles/main.scss";

function App() {
  return (
    <div>
      <Route exact path="/" component={Homepage} />
      <Route exact path="/hats" component={Homepage} />
      <Homepage />
    </div>
  );
}

export default App;
